  false,\n\t\"url\": null,\n\t\"notes\": \"The Endangered Species Act (ESA) Section
  7 requires federal agencies to ensure that actions they authorize, fund or carry
  out are not likely to jeopardize the continued existence of endangered, threatened
  or proposed species. Federal actions also should not result in the destruction or
  adverse modification of designated critical habitat for these species. This Biological
  Assessment (BA) provides documentation and analysis of potential impacts to federally-listed
  threatened and endangered species for the proposed action. Candidate species for
  federal listing are not protected under the ESA. However, it is within the spirit
  of the Act to consider potential impacts to these species to prevent possible future
  listing. This BA also addresses candidate species that may be affected by alternative
  actions.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
